import React from "react";

function EmployeList({ list, showAlert, empID }) {
  console.log(list);
  console.log(empID);

  const empDept = list.map((item) => {
    return <h3>{item.dept}</h3>;
  });

  return <div className="contsiner">{empDept}</div>;
}

export default EmployeList;
